import {useNavigate} from "react-router-dom"

function Login(){
	const navigate = useNavigate()

	const onNavigate = () => {
		navigate("/homepage")
	}

	return(
		<div>
			<h1>Test</h1>
			<button onClick={onNavigate}>Login</button>
		</div>
	)
}
export default Login
